import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

const ListaProfesional = () => {
  const { id } = useParams();
  const [profesional, setProfesionales] = useState([]);

  useEffect(() => {
  axios.get(`http://localhost:3000/profesionales`)

      .then(response => setProfesionales(response.data))
      .catch(error => console.error(error));
  }, [id]);
/*
    .then(response => {
      const categoriaId = localStorage.getItem('categoriaId');
      const profesionalesFiltrados = response.data.filter(profesional => profesional.Oficios_idOficios === parseInt(categoriaId));
      setProfesionales(profesionalesFiltrados);
    })
    .catch(error => console.error(error));
}, []);

